import React,{ Fragment } from 'react';


function App() {
  return (
    <Fragment>
    <div className='App'>
      <nav className='navbar navbar-expand-lg navbar-dark bg-dark'>
        <div className='navbar-header'>
          <a className='navbar-brand' href='#'>DTE</a>
        </div>
        <button className='navbar-toggler' type='button' data-toggle='collapse' data-target='#vanbarNav' aria-controls='navbarNav' aria-expanded='false' aria-label='Toggle navigation'>
          <span className='navbar-toggler-icon'></span>
        </button>
        <div className='collapse navbar-collapse' id='navbarNav'>
          <ul className='navbar-nav mr-auto'>
            <li className=''></li>
          </ul>
        </div>
      </nav>

    </div>
    </Fragment>
  );
}

export default App;
